import './Ordering.css';

function Ordering({ setQuery }) {
    const handleNewest = event => {
        setQuery('?ordering=-published_at');
    }

    const handleOldest = event => {
        setQuery('?ordering=published_at');
    }
    return (
        <div className="dropdown">
            <button>Ordering</button>
            <div class="dropdown-content">
            <button id="newest" on={handleNewest}>Newest</button>
            <button id="oldest" href={handleOldest}>Oldest</button>
            </div>
        </div>
    )
}

export default Ordering
